        getPlaylistTracks('2nl9SlGjsTme17ffmNpZGp')
        console.log(playlistTracks)
    },[])

    return(
        <div className='container-main mb-0 h-screen bg-navy-700'>
            {mappedTracks}
        </div>
    )
}
